- input: "TEXT\x1CC00420935\x1CT-123456\x1C\x1CF3N\x1CPlease note: The committee has
    taken steps to clear out old stale checks from the books. On Line 20a, the committee
    has voided contribution refunds on November 12th 2013 to:  Carole Bahmani for
    $1000, Safra Catz for $2000, Denise Henry for $1000. Each of these contribution
    refunds were re-issued on 12/12/13. On Line 17, we have voided contribution refunds
    on November 12th 2013 to:  Becton, Dickinson, and Company PAC  for $1000, and
    Blue Cross Blue Shield Association PAC BluePAC for $2000. Each of these contribution
    refunds will not be re-issued as the contributors did not exceed contribution
    limits. On Line 17, the committee has voided payments on November 12th 2013 to:
    \ Congressman Kevin McCarthy Office Supply Account for $163, and McGuire Woods
    LLP for  $2021.25 on page # These checks were lost and are not required to be
    reissued. On Line 17, the committee has voided payments on November 12th 2013
    to:  Aramark for $120, and Oracle Corporation for $51.04. These checks were lost
    and were reissued on 12/12/13. On Line 17, a check to Majority Committee PAC for
    $1171.40 was voided on November 12th 2013.  The original reimbursement check (3/26/12)
    for $1171.40 was cut for an incorrect amount. This check was lost and never cashed.
    \ We have discovered that the check should have been for $598.60 to reimburse
    the Majority Committee PAC for a credit card charge that was made in error. We
    have corrected this error by re-issuing the reimbursement check for $598.60 to
    Majority PAC. On Line 21, the committee has voided political and charitable contributions:
    to California Young Republicans Leadership Fund for $250, Elect Blake Farenthold
    Committee for $2000, Friends Of Dennis Ross for $1000, Young Survival Coalition
    for $1000, Mchenry For Congress for $2000 and Mchenry For Congress for $2000.
    \ These checks were lost and will not be reissued.\n"
